Let's proceed step by step:

## 1. Key Psychological Mechanisms Involved

- **Inequity aversion:** Responders dislike outcomes where payoffs are unfair, often rejecting offers they perceive as unfair, even at a cost.
- **Self-interest:** Responders want to maximize their own payoff (split_self).
- **Contribution norm:** Offers are judged not only by the split, but by how the participant contributed relative to the opponent (token_self vs token_opp). A small share feels more unfair if the responder contributed more.
- **Sensitivity to total stakes:** The same share feels differently when the total amount is higher or lower. (i.e., weighting by combined_earning).

## 2. Mechanisms Interactions

- Responders integrate absolute payoff (split_self), their share relative to the opponent (splitperc_self - splitperc_opp), and their share relative to their contribution ((split_self / combined_earning) vs (token_self / (token_self + token_opp))).
- These factors are weighted by subjective preferences (learnable parameters) reflecting individual sensitivity to fairness and payoff.
- There is a possible bias/tolerance parameter for overall acceptance.

## 3. Mathematical Form Possibilities

We want a model that is:
- Motivated by Fehr-Schmidt (inequity aversion), possibly with a normalization for contributions.
- Simple enough to avoid high parameter covariance.

**Candidate formula (highly compact):**

Let:
- Utility = β_self * split_self (absolute gain)
- - β_ineq * max(0, splitperc_opp - splitperc_self) (disadvantageous inequality)
- - β_contrib * |(split_self / combined_earning) - (token_self / (token_self + token_opp))| (deviation from contribution norm)

This captures:
- Valuing own payout
- Dislike of being treated unfairly (getting less than the other, relative to percentage)
- Dislike of offers that deviate from one's contribution

Only three learnable parameters: β_self, β_ineq, β_contrib. Potentially add a bias/intercept term.

## 4. Parameter List

- β_self: Weight given to own payoff
- β_ineq: Weight given to disadvantageous inequality
- β_contrib: Weight given to deviation from contribution norm
- bias: Overall tendency to accept/reject (constant intercept, optional for baseline propensity)

Each parameter bounded, e.g. [-15, 15], which is wide and standard for similar modeling.

## 5. Model to Observable Mapping

- The model outputs utility (real value); higher utility = more likely to accept.
- Utility transformed via logistic to a probability of accept; thresholded at 0.5 for binary prediction.

---

**Decision:**
- Let's use all three terms plus a bias for best fit and parameter recovery, but not more, to avoid degeneracy.

---

## Model Specification

<MODEL>
utility = bias + beta_self * split_self - beta_ineq * max(0, splitperc_opp - splitperc_self) - beta_contrib * abs((split_self / combined_earning) - (token_self / (token_self + token_opp)))
</MODEL>

